webpackJsonp([0xc16286ab2a8a],{920:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Most props on a JSX element are passed on to the component, however, there are two special props (<code>ref</code> and <code>key</code>) which are used by React, and are thus not forwarded to the component.</p>\n<p>For instance, attempting to access <code>this.props.key</code> from a component (i.e., the render function or <a href="https://reactjs.org/docs/typechecking-with-proptypes.html#proptypes">propTypes</a>) is not defined. If you need to access the same value within the child component, you should pass it as a different prop (ex: <code>&#x3C;ListItemWrapper key={result.id} id={result.id} /></code>). While this may seem redundant, itâ€™s important to separate app logic from reconciling hints.</p>',frontmatter:{title:"Special Props Warning",next:null,prev:null},fields:{path:"warnings/special-props.md",slug:"warnings/special-props.html"}}},pathContext:{slug:"warnings/special-props.html"}}}});
